Block fall.update:
for (var y=(pins.matrice.length - 2) ; y>=0 ; y--) {
    for (var x=0 ; x<pins.matrice[0].length ; x++) {
        if (pins.matrice[y+1][x]===0 && pins.matrice[y][x]!==0) {
            pins.matrice[y+1][x] = pins.matrice[y][x];
            pins.matrice[y][x] = 0;
        }
    }
}
return RW.signals.DONE;

Score.update:
for (var x=0 ; x<pins.matrice[0].length ; x++) {
    if (pins.matrice[pins.matrice.length-1][x]!==0) {
        pins.matrice[pins.matrice.length-1][x] = 0;
        if (x<10) {
            pins.scorePlayerB = pins.scorePlayerB+1;
        } else {
            pins.scorePlayerA = pins.scorePlayerA+1;
        }
    }
}
return RW.signals.DONE;

CheckKeys.update:
for (var key=65 ; key<90 ; key++) {
    if (pins.keymap[key]!==undefined) {
        var id = key-64;
        for (var y=0 ; y<pins.matrice.length ; y++) {
            for (var x=0 ; x<pins.matrice[0].length ; x++) {
                if (pins.matrice[y][x]===id) pins.matrice[y][x] = 0;
            }
        }
    }
}
return RW.signals.DONE;

drawMapFromTileset.body:
var framesPerLine = tileset.sheetSize[0] / tileset.frameSize[0];

scale = (scale)?scale:1;

var liste = [];

for (var y=0 ; y<matrice.length ; y++) {
    for (var x=0 ; x<matrice[0].length ; x++) {
        if (matrice[y][x]===0) continue;
        var imageCoords = [(matrice[y][x]-1) % framesPerLine, Math.floor((matrice[y][x]-1) / framesPerLine)];
        liste.push({
            type: "image",
            asset: tileset.asset,
            position: [position[0]+x*tileset.frameSize[0], position[1]+y*tileset.frameSize[1]],
            offset: [imageCoords[0] * tileset.frameSize[0], imageCoords[1] * tileset.frameSize[1]],
            size: tileset.frameSize,
            scale: scale
        });
    }
}

return liste;

